    constructor(props) {
        super(props)
        this.handleClick = this.handleClick.bind(this);

        this.state = {
                url: 'https://cs371-backend.herokuapp.com/list/',
                movies: [],
                lists: []
        }
    }

    componentDidMount() {
        $.ajax({
            url: "test.html",
            context: document.body
          }).done(function() {
            $( this ).addClass( "done" );
          });
        $.ajax({
            method: "GET",
            url: this.state.url,
            context: document,
            success: (data) => {
                this.setState({
                    lists: data.results
                })
            },
            error: (data) => {
                alert("Error");
            }
        })
    }

