    }

    render() {
        let link;
        return (
            <div>
                {this.state.movies.map((data)=>{
                    return(
                        <div>
                            <h1>{data.title}</h1>
                        </div>
                    )
                })}
            </div>
        );
    }
}
export default Lists;
